<!DOCTYPE html>
<html lang="vi">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Migraion Microsoft 365</title>
    <script src="https://cdn.jsdelivr.net/npm/chart.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/chartjs-plugin-datalabels@2.0.0"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/animejs/3.2.1/anime.min.js"></script>
    <style>
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            margin: 0;
            padding: 0;
            background: linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%);
            color: #333;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
        }

        h1 {
            text-align: center;
            color: #2c3e50;
            margin-bottom: 30px;
            font-size: 2.5em;
            text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
        }

        .dashboard {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }

        .card {
            background: white;
            border-radius: 10px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            padding: 20px;
            transition: transform 0.3s ease;
        }

        .card:hover {
            transform: translateY(-5px);
        }

        .card h2 {
            margin-top: 0;
            color: #34495e;
            font-size: 1.2em;
        }

        .chart-container {
            position: relative;
            height: 200px;
        }

        .stat {
            font-size: 2em;
            font-weight: bold;
            color: #3498db;
            margin: 10px 0;
        }

        .progress-bar {
            background: #ecf0f1;
            height: 10px;
            border-radius: 5px;
            overflow: hidden;
        }

        .progress {
            height: 100%;
            background: #3498db;
            width: 0;
            transition: width 1s ease-in-out;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 20px;
            background: white;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        th,
        td {
            padding: 12px;
            text-align: left;
            border-bottom: 1px solid #ddd;
        }

        th {
            background-color: #34495e;
            color: white;
        }

        tr:nth-child(even) {
            background-color: #f8f9fa;
        }

        tr:hover {
            background-color: #e9ecef;
        }

        .search-container {
            margin-bottom: 20px;
        }

        #searchInput {
            width: 100%;
            padding: 10px;
            font-size: 16px;
            border: 1px solid #ddd;
            border-radius: 5px;
        }

        .status-indicator {
            display: inline-block;
            width: 10px;
            height: 10px;
            border-radius: 50%;
            margin-right: 5px;
        }

        .status-stopped {
            background-color: #0011ff;
        }

        .status-synced {
            background-color: #2ecc71;
        }
        .status-failed {
            background-color: #fa0404;
        }
    </style>
</head>

<body>
    <div class="container">
        <h1>Biểu đồ Migration Microsoft 365</h1>
        <div class="dashboard">
            <div class="card">
                <h2>Tổng số tài khoản</h2>
                <div class="stat" id="totalAccounts">0</div>
                <div class="progress-bar">
                    <div class="progress" id="accountsProgress"></div>
                </div>
            </div>
            <div class="card">
                <h2>Trạng thái</h2>
                <div class="chart-container">
                    <canvas id="statusChart"></canvas>
                </div>
            </div>
            <div class="card">
                <h2>Điểm nhất quán dữ liệu</h2>
                <div class="chart-container">
                    <canvas id="consistencyChart"></canvas>
                </div>
            </div>
            <div class="card">
                <h2>Tổng mục đã đồng bộ</h2>
                <div class="stat" id="totalSynced">0</div>
                <div class="progress-bar">
                    <div class="progress" id="syncedProgress"></div>
                </div>
            </div>
        </div>
        <div class="search-container">
            <input type="text" id="searchInput" placeholder="Tìm kiếm tài khoản...">
        </div>
        <table id="dataTable">
            <thead>
                <tr>
                    <th>Tài khoản</th>
                    <th>Trạng thái</th>
                    <th>Điểm nhất quán dữ liệu</th>
                    <th>Số mục đã đồng bộ</th>
                    <th>Số mục bị bỏ qua</th>
                </tr>
            </thead>
            <tbody></tbody>
        </table>
    </div>
